import React from 'react';
import { Row, Col, Container } from "react-bootstrap";
import {Button} from 'react-bootstrap';
import NavBar from '../components/NavBar';



const Lending = (() =>{

    return (

<div className="wrapper">
<div className='bg'> 
  <NavBar />
  </div>

    <Row className="mt-2">
    <Col lg={12} sm={12} xs={12} md={12}>
  


  
  <div className='textone'> Салон керамической плитки </div>
  <div className='texttwo'> Место, где всё чётко </div>

  
 

 
   
   </Col> 
   </Row>
   <div className='cont'> 
   <div className='block'> 
   <b className='textthree'> Россия </b>
   <b className='textthree'> Италия </b>
   <b className='textthree'> Испания </b>
   <b className='textthree'> Беларуссия </b>
   <b className='textthree'> Польша </b>
   
</div>

<div className='text'> Мы предлагаем </div>
<div className='textfour'> Широкий ассортимент </div>
<div className='textfour'> Доступные цены </div>
<div className='textfour'> Индивидуальный подход </div>
<div className='textfour'> 3D-дизайн БЕСПЛАТНО </div>
<div className='textfour'> Акции и гибкая система скидок на ВСЕ позиции </div>
<div className='textfour'> Доставка </div>
</div>
</div>   




);
});

export default Lending;
